import React, { useState, useEffect } from "react";
import NavBar from "./Navbar";

function StudentActive() {
  // Assuming you have an array of active exams with properties: examName, startTime, and endTime
  const [activeExams, setActiveExams] = useState([]);

  useEffect(() => {
    
    // Fetch active exams data from your API or data source
    // Replace the following with your actual endpoint or data fetching logic
    fetch('http://localhost:4002/api/examview/')
      .then((res) => res.json())
      .then((result) => setActiveExams(result));
  }, []);





  return (
    <>
      <NavBar />
      <div className="container mt-4">
        <h4 className="mb-4 text-center">Active Exams</h4>
        <table className="table table-bordered">
          <thead>
            <tr>
              <th>Exam Name</th>
              <th>Exam Dat</th>
              <th>Start Time</th>
              <th>End Time</th>
            </tr>
          </thead>
          <tbody>
            {activeExams.map((exam) => (
              <tr key={exam.examId}>
                <td>{exam.title}</td>
                <td>{exam.scheduledstartTime}</td>
                {/* <td>{new Date(exam.scheduledDate).toLocaleString()}</td> */}
                <td>{exam.scheduledendTime}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
}

export default StudentActive;
